column8:
ボイスアラームが危険を知らせ、歩行者や自転車の安全を守ります。<br>
狭い道路・交差点を歩く子供達やお年寄り、自転車などの交通弱者に対して、クリアな音声で危険を知らせるナンバープレートスピーカー。<br>
【特長】・安全、安心。音と光で危険を知らせる。・LEDライトで車両接近を知らせる。ナンバープレートとフレームを振動させ音を増幅させる薄型軽量スピーカー。フラットパネルスピーカーで、小型軽量、ハイパワー。(フラットパネルスピーカー：高い指向性・明瞭音が遠くまで届く・早い立ち上がり・軽量コンパクト・耐久性)。メッキフレームで格好良く、車体にマッチ。取り付け簡単！(ナンバープレートを外して配線するだけ)/乗用車、軽自動車、タクシー、営業車、小型トラック・・・幅広い車種に対応<br><style type="text/css">
